<description>&lt;div class="pageBefore">&lt;img src="http://78.46.73.113/wiki/images/z.gif" width="1" height="1" border="0" alt="" style="display:block" align="top" />&lt;/div>&lt;div class="page">
&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/SekcijaConfiguredPol'zovatelejj&amp;amp;v=15f9" class="">/Документация&amp;nbsp;IP&amp;nbsp;Studio&amp;nbsp;AMBS&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Операторы&amp;nbsp;/&amp;nbsp;Раздел&amp;nbsp;Edit&amp;nbsp;Operators&amp;nbsp;/&amp;nbsp;Секция&amp;nbsp;Configured&amp;nbsp;Пользователей&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/SekcijaConfiguredPol'zovatelejj&amp;amp;time=2007-06-22+17%3A24%3A12">2007-06-22 17:24:12&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=DokumentacijaIPStudioAMBS/RazdelOperatory/RazdelEditOperators/SekcijaConfiguredPol'zovatelejj&amp;amp;time=2007-06-26+12%3A49%3A14">2007-06-26 12:49:14&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">При&amp;nbsp;наведении на&amp;nbsp;эту иконку курсора мыши, будет показано всплывающее окно с&amp;nbsp;параметрами пользователя. &lt;br />
Для&amp;nbsp;добавления нового пользователя или&amp;nbsp;редактирования уже&amp;nbsp;существующих в&amp;nbsp;системе при&amp;nbsp;нажатии на&amp;nbsp;соответствующие кнопки будет вызвана форма параметров пользователя:&lt;br />
Содержит правила преобразования номера вызываемого абонента. Как&amp;nbsp;правило, состоит из&amp;nbsp;двух частей, разделенных символом “/”&lt;br />
Строка поиска для&amp;nbsp;удобства может быть разделена на&amp;nbsp;секции символом &lt;!--notypo-->“|”&lt;!--/notypo-->. В&amp;nbsp;строке замены можно использовать подстроку, удовлетворяющую условию секции, указав номер секции после символа ”\”. Для&amp;nbsp;использования в&amp;nbsp;строке замены подстроки, удовлетворяющей всем секциям одновременно служит символ “&amp;”. Необязательное поле.&lt;br />
Содержит правила преобразования номера вызывающего абонента. Как&amp;nbsp;правило, состоит из&amp;nbsp;двух частей, разделенных символом “/”&lt;br />
Строка поиска для&amp;nbsp;удобства может быть разделена на&amp;nbsp;секции символом &lt;!--notypo-->“|”&lt;!--/notypo-->. В&amp;nbsp;строке замены можно использовать подстроку, удовлетворяющую условию секции, указав номер секции после символа ”\”. Для&amp;nbsp;использования в&amp;nbsp;строке замены подстроки, удовлетворяющей всем секциям одновременно служит символ “&amp;”. Необязательное поле.&lt;br />
0 &amp;ndash; NAT&amp;nbsp;не&amp;nbsp;используется,&lt;br />
Сохраняет внесенные изменения и&amp;nbsp;закрывает окно редактирования&lt;/div>&lt;br />
&lt;b>Удалено:&lt;/b>&lt;br />
&lt;div class="deletions">При&amp;nbsp;наведение на&amp;nbsp;эту иконку курсора мыши, будет показано встплывающее окно с&amp;nbsp;параметрами пользователя. &lt;br />
Для&amp;nbsp;добавления нового пользователя или&amp;nbsp;редактирования уже&amp;nbsp;существующих в&amp;nbsp;системе, при&amp;nbsp;нажатии на&amp;nbsp;соответствующие кнопки будет вызвана форма параметров пользователя:&lt;br />
Содержат правила преобразования номера вызываемого абонента. Как&amp;nbsp;правило, состоит из&amp;nbsp;двух частей, разделенных символом “/”&lt;br />
Строка поиска, для&amp;nbsp;удобства, может быть разделена на&amp;nbsp;секции символом &lt;!--notypo-->“|”&lt;!--/notypo-->. В&amp;nbsp;строке замены можно использовать подстроку, удовлетворяющую условию секции, указав номер секции после символа ”\”. Для&amp;nbsp;использования в&amp;nbsp;строке замены подстроки, удовлетворяющей всем секциям одновременно служит символ “&amp;”. Необязательное поле.&lt;br />
Содержат правила преобразования номера вызывающего абонента. Как&amp;nbsp;правило, состоит из&amp;nbsp;двух частей, разделенных символом “/”&lt;br />
Строка поиска, для&amp;nbsp;удобства, может быть разделена на&amp;nbsp;секции символом &lt;!--notypo-->“|”&lt;!--/notypo-->. В&amp;nbsp;строке замены можно использовать подстроку, удовлетворяющую условию секции, указав номер секции после символа ”\”. Для&amp;nbsp;использования в&amp;nbsp;строке замены подстроки, удовлетворяющей всем секциям одновременно служит символ “&amp;”. Необязательное поле.&lt;br />
0 &amp;ndash; NAT&amp;nbsp;не&amp;nbsp;используеться,&lt;br />
Сохраняет внесенные изминения и&amp;nbsp;закрывает окно редактирования&lt;/div>&lt;/div>
</description>
